import React from "react";
import { Dialog, DialogTitle } from "@material-ui/core";

const Profile = (props) => {
	return (
		<Dialog
			open={props.open}
			onClose={props.onClose}
		>
			<DialogTitle>
			Profile Information
			</DialogTitle>			
		</Dialog>
	);
};

export default Profile
